import logo from "../../img/header/favicon.svg.png"
import youtube from '../../img/footer/youtube.svg';

import facebook from '../assets/facebook.png';
import twitter from '../assets/twitter.png';
import linkedin from '../assets/linkedin.png';
import instagram from '../assets/instagram.png';
import '../../home.css';

export default function Footer(){
    return (
        <footer className="footer">
          <div className="footer-top">
            <img src={logo} alt="QUE CHOISIR" className="footer-logo" />
            <div className="footer-section">
              <h3>UFC-Que Choisir</h3>
              <ul>
                <li>Devenir adhérent de l’association</li>
                <li>Faire un don à l’UFC-Que Choisir</li>
                <li>Qui sommes-nous ?</li>
              </ul>
            </div>
          </div>
          <div className="footer-bottom">
            <div className="social-media"> 

              <a href="https://www.youtube.com/user/ufcquechoisir" className="social-icon">
                <img src={youtube} alt="YouTube" />
              </a>
              {/* <a href="https://www.facebook.com/UFCquechoisir/"><img src={facebook} alt="Facebook" /></a>
              <a href="https://x.com/ufcquechoisir"><img src={twitter} alt="Twitter" /></a>
              <a href="https://www.linkedin.com/company/ufc-que-choisir/"><img src={linkedin} alt="LinkedIn" /></a>
              <a href="https://www.instagram.com/ufcquechoisir/"><img src={instagram} alt="Instagram" /></a>
              */}
            </div>
            <div className="footer-links">
              <p>Association indépendante de l’État, des syndicats, des producteurs et des distributeurs depuis 1951.</p>
            </div>
          </div>
        </footer>
      );
}
